import React  from 'react';
import { Card, CardContent, Typography, Grid } from '@material-ui/core';
import styles from './Cards.module.css';

const Cards = ({confirmed, recovered, deaths, lastUpdate}) => {
console.log(confirmed);
  if(!confirmed){
      return'Loading';
  }
   return(
    <div className={styles.container}>
    <Grid container spacing={3} justify="center">
      <Grid item component = {Card}>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>Infected</Typography>
        <Typography variant="h4">{confirmed.value}</Typography>
       <Typography  color="textSecondary">REAL DATE</Typography>
       <Typography variant="body2">Number of active cases of COVID-19</Typography>
      </CardContent>
      </Grid>
       <Grid item component = {Card}>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>Recovered</Typography>
        <Typography variant="h4">REAL Data</Typography>
       <Typography  color="textSecondary">REAL DATE</Typography>
       <Typography variant="body2">Number of recovered cases from COVID-19</Typography>
      </CardContent>
      </Grid>
       <Grid item component = {Card}>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>Death</Typography>
        <Typography variant="h4">REAL Data</Typography>
       <Typography  color="textSecondary">REAL DATE</Typography>
       <Typography variant="body2">Number of Deaths caused by COVID-19</Typography>
      </CardContent>
      </Grid>
    </Grid>
    </div>
   )
}
export default Cards;
